description:
Includes the Ricky Gervais Show from the XFM network, The Ricky Gervais Show Guardian Unlimited podcast and the Podfather Trilogy holiday podcasts.

The Ricky Gervais Show is a comedy audio show in the UK starring Ricky Gervais, Stephen Merchant, and Karl Pilkington. The show started in November 2001 on Xfm, and aired in weekly periods for months at a time throughout 2002, 2003, 2004, and mid-2005. In November 2005, Guardian Unlimited offered the show as a podcast series of 12 shows. Throughout January and February 2006, the podcast was consistently ranked the number one podcast in the world; it appeared in the 2007 Guinness World Record for the world&amp;#039;s most downloaded podcast, having gained an average of 261,670 downloads per episode during its first month.
